s\\r\\nApples, Beetroots, Carrots, Almonds, Cashews, Cardamom & Country Jaggery,\\r\\nMETHOD \\r\\nAdd 1 tablespoon of ABC Malt to 120 ml of warm or cold milk. Mix thoroughly by pouring the drink between two tumblers. Strain it once and savor.\\r\\nDo not add extra sugar as it contains Naatuchakkarai ( Country Jaggery )\\r\\nIt can be consumed as is or with hot water for those with lactose intolerance.\\r\\nStore it in an airtight container or refrigerate it for a longer shelf life.\\r\\nDo not mix ABC Malt with raw milk or boiling milk.\\r\\n\\r\\n100% Natural Drink\\r\\nA heart-healthy start to your day\\r\\nSupports Detox.\\r\\nImproves Athletic Performance.\\r\\nNutrient-dense.\\r\\nImmune-System Boosting.\\r\\nStrengthens your eye muscles\",\"status\":\"1\",\"weight\":\"0.2\",\"seo_url\":\"test\",\"size_id\":null,\"storeid\":4,\"eng_name\":null,\"imageurl\":null,\"quantity\":86,\"shrtdesc\":\"<ul>\\r\\n  <li>100% Natural Drink</li>\\r\\n  <li>A heart-healthy start to your day</li>\\r\\n  <li>Supports Detox</li>\\r\\n  <li>Improves Athletic Performance</li>\\r\\n  <li>Nutrient-dense</li>\\r\\n  <li>Immune-System Boosting</li>\\r\\n  <li>Strengthens your eye muscles</li>\\r\\n</ul>\",\"addtocart\":true,\"sortorder\":0,\"variation\":\"5\",\"weight_id\":209,\"created_at\":\"2024-04-20 18:10:01\",\"updated_at\":\"2024-10-07 11:25:51\",\"visibility\":1,\"category_id\":81,\"is_featured\":null,\"products_id\":3338,\"cartquantity\":1,\"category_ids\":null,\"customizable\":0,\"category_name\":\"Nutrition Foods\",\"city_shipping\":null,\"colorcodes_id\":null,\"delivery_time\":null,\"state_shipping\":null,\"category_status\":1,\"category_subcat\":0,\"category_cat_img\":null,\"category_seo_url\":\"nutrition-foods\",\"category_storeid\":4,\"national_shipping\":null,\"products_group_id\":1977,\"category_parent_id\":80,\"category_sortorder\":0,\"category_created_at\":\"2023-12-21 13:16:56\",\"category_updated_at\":\"2024-05-21 15:56:23\",\"category_description\":null,\"categor