 Ginger Awaits</li><li>Boost Immunity with Dry Ginger Powder</li><li>Premium Dry Ginger Powder for Health</li></ul>\",\"addtocart\":true,\"sortorder\":0,\"variation\":\"5\",\"weight_id\":301,\"created_at\":\"2024-03-02 17:46:39\",\"updated_at\":\"2024-03-29 10:05:37\",\"visibility\":1,\"category_id\":63,\"is_featured\":null,\"products_id\":2248,\"cartquantity\":\"4\",\"category_ids\":null,\"customizable\":0,\"category_name\":\"Herbal Powders\",\"city_shipping\":null,\"colorcodes_id\":null,\"delivery_time\":null,\"state_shipping\":null,\"category_status\":1,\"category_subcat\":2,\"category_cat_img\":\"https://assetsvilva.blr1.cdn.digitaloceanspaces.com/thaithingal/category-image/traditional-medicine.png\",\"category_seo_url\":\"herbal-powders\",\"category_storeid\":4,\"national_shipping\":null,\"products_group_id\":929,\"category_parent_id\":61,\"category_sortorder\":0,\"category_created_at\":\"2023-12-21 13:16:56\",\"category_updated_at\":\"2024-05-21 15:56:23\",\"category_description\":null,\"category_is_featured\":1,\"category_meta_tag_desc\":null,\"category_meta_tag_title\":null,\"category_meta_tag_keywords\":null},{\"id\":2225,\"sp\":30,\"mrp\":30,\"sku\":\"TT-TM-RH-JSP\",\"esin\":\"2225634260\",\"name\":\"Jamun Seed Powder (50gm)\",\"descp\":\"<h1>Discover the Benefits of Jamun Seed Powder ?✨</h1><p></p><p>Jamun seed powder, derived from the seeds of the nutritious jamun fruit (Indian black plum), is a powerhouse of health benefits. Rich in antioxidants, vitamins, and minerals, this natural remedy supports digestive health, regulates blood sugar levels, and promotes overall wellness. Incorporating jamun seed powder into your daily routine can help you achieve a healthier lifestyle! ??</p><br><h2>A Natural Aid for Blood Sugar Control ??</h2><p></p><p>Support healthy blood sugar levels with jamun seed powder! Known for its ability to improve insulin sensitivity, this herbal remedy can be particularly beneficial for those managing diabetes. Add jamun seed powder t