mixture, and massage it onto the scalp. This treatment can result in thicker, shinier, and darker hair, providing a natural solution for hair-related concerns.\\nMoreover, the consumption of Amla powder can have numerous positive effects on the body. It helps increase prana gas, rejuvenate cells, and support the efficient elimination of waste, contributing to overall well-being. When given to children, paddy powder can boost physical strength and vitality. Notably, gooseberry is also beneficial for addressing stomach ulcers, chest irritation, and digestive issues, showcasing its versatile medicinal properties.\\nFurthermore, Amla powder has been linked to lowering cholesterol levels, aiding in weight loss efforts, and serving as a valuable remedy for diabetes management. Its multifaceted benefits make it a valuable addition to a holistic approach to health and wellness.\",\"images\":[\"nellikai_podi.webp\"],\"status\":\"001\",\"weight\":50,\"seo_url\":\"amla-gooseberry-powder\",\"size_id\":null,\"storeid\":4,\"eng_name\":\"Amla / Gooseberry powder\",\"imageurl\":\"nellikai_podi.webp\",\"quantity\":100,\"addtocart\":true,\"sortorder\":0,\"variation\":null,\"weight_id\":0,\"created_at\":\"2024-03-02 17:46:39\",\"updated_at\":\"2024-03-02 17:46:39\",\"category_id\":62,\"is_featured\":null,\"products_id\":2228,\"cartquantity\":\"4\",\"customizable\":0,\"category_name\":\"உலர் மூலிகைகள்\",\"city_shipping\":null,\"colorcodes_id\":null,\"delivery_time\":null,\"state_shipping\":null,\"category_status\":1,\"category_subcat\":1,\"category_cat_img\":\"https://assetsvilva.blr1.cdn.digitaloceanspaces.com/thaithingal/category-image/herbal-cosmetics.png\",\"category_seo_url\":\"raw-herbal\",\"category_storeid\":4,\"national_shipping\":null,\"products_group_id\":909,\"category_parent_id\":61,\"category_sortorder\":0,\"category_created_at\":\"2023-12-21 13:16:56\",\"category_updated_at\":\"2024-03-07 17:20:29\",\"category_description\":null,\"category_is_featured\":1,\"category_meta_tag_desc\":null,\"category_meta_tag_title\":null,\"category_meta_tag_keywords\":null},{\"id\":2225,\"sp\":30,\"mrp\":30,\"sku\":null,\"name\":\"நாவல் விதைப்பொடி\",\"descp\":\"Jamun Seed Powder\\nJamun Seed powder to control diabetes\\nJamun Seed powder is truly a superfood with its wide range of health benefits. In addition to keeping blood pressure in check and preventing sodium buildup, it also plays a crucial role in regulating insulin levels to manage diabetes effectively.\\nBy incorporating Jamun Seed powder into your daily routine, you can give your immune system a significant boost. Not only does it promote immunity, but it also aids in strengthening bones and alleviating body pains, allowing you to lead a more active lifestyle.\\nFurthermore, the wonders of Jamun Seed powder extend to improving digestive health and fortifying the liver. Its properties help enhance your digestive power and support the overall well-being of your liver. Embrace the power of Jamun Seed powder as a natural way to enhance your health and vitality.\\nMethod of use\\nTake one tablespoon of the powder mixed with lukewarm water or dipped in honey both morning and night. Take food after 30 minutes.\",\"images\":[\"navalvithai_podi.webp\"],\"status\":\"001\",\"weight\":50,\"seo_url\":\"jamun-seed-powder\",\"size_id\":null,\"storeid\":4,\"eng_name\":\"Jamun Seed Powder\",\"imageurl\":\"navalvithai_podi.webp\",\"quantity\":100,\"addtocart\":true,\"sortorder\":0,\"variation\":null,\"weight_id\":0,\"created_at\":\"2024-03-02 17:46:39\",\"updated_at\":\"2024-03-02 17:46:39\",\"category_id\":62,\"is_featured\":null,\"products_id\":2225,\"cartquantity\":\"4\",\"customizable\":0,\"category_name\":\"உலர் மூலிகைகள்\",\"city_shipping\":null,\"colorcodes_id\":null,\"delivery_time\":null,\"state_shipping\":null,\"category_status\":1,\"category_subcat\":1,\"category_cat_img\":\"https://assetsvilva.blr1.cdn.digitaloceanspaces.com/thaithingal/category-image/herbal-cosmetics.png\",\"category_seo_url\":\"raw-herbal\",\"category_storeid\":4,\"national_shipping\":null,\"products_group_id\":906,\"category_parent_id\":61,\"category_sortorder\":0,\"category_created_at\":\"2023-12-21 13:16:56\",\"category_updated_at\":\"2024-03-07 17:20:29\",\"category_description\":null,\"category_is_featured\":1,\"category_meta_tag_desc\":null,\"category_meta_tag_title\":null,\"category_meta_tag_keywords\":null},{\"id\":2175,\"sp\":30,\"mrp\":30,\"sku\":null,\"name\":\"கீழாநெல்லி பொடி\",\"descp\":\"Keezhanelli powder\\nThe best remedy for Jaundice is Keezhanelli Podi\\nKeezhanelli is also used as a medicine to cure infectious diseases caused by poisonous germs.\\nTaking dry paddy powder three times before meals can control diabetes. Prevents kidney and liver damage and saves us from dialysis\\nCleanses the liver. Helps reduce inflammation of the liver. It helps to overcome the side effects of modern medicines. Balanced digestion occurs.\\nKeezhanelli powder, also known as the best remedy for Jaundice, has been trusted for its various health benefits. This powerful powder is effective in eliminating jaundice, reducing body heat, clearing toxins, and even aiding in managing diabetes. Beyond that, Keezhanelli is recognized for its ability to combat infectious diseases caused by harmful bacteria.\\nIt is recommended to consume dry paddy powder three times a day before meals to help regulate diabetes, prevent kidney and liver damage, and minimize the need for dialysis. Additionally, Keezhanelli powder plays a vital role in cleansing and reducing inflammation in the liver, while also mitigating the adverse effects of modern medications. By promoting balanced digestion, this natural remedy can significantly improve overall health and well-being.\",\"images\":[\"raw/keelenelli_podi.webp\"],\"status\":\"001\",\"weight\":50,\"seo_url\":\"keelanelli- powder\",\"size_id\":null,\"storeid\":4,\"eng_name\":\"Keelanelli Powder\",\"imageurl\":\"raw/keelenelli_podi.webp\",\"quantity\":100,\"addtocart\":true,\"sortorder\":0,\"variation\":null,\"weight_id\":0,\"created_at\":\"2024-02-28 11:27:57\",\"updated_at\":\"2024-02-28 11:27:57\",\"category_id\":63,\"is_featured\":null,\"products_id\":2175,\"cartquantity\":\"2\",\"customizable\":0,\"category_name\":\"மூலிகை பொடிகள்\",\"city_shipping\":null,\"colorcodes_id\":null,\"delivery_time\":null,\"state_shipping\":null,\"category_status\":1,\"category_subcat\":2,\"category_cat_img\":\"https://assetsvilva.blr1.cdn.digitaloceanspaces.com/thaithingal/category-image/traditional-medicine.png\",\"category_seo_url\":\"herbal-powders\",\"category_storeid\":4,\"national_shipping\":null,\"products_group_id\":862,\"category_parent_id\":61,\"category_sortorder\":0,\"category_created_at\":\"2023-12-21 13:16:56\",\"category_updated_at\":\"2024-03-07 17:19:16\",\"category_description\":null,\"category_is_featured\":1,\"category_meta_tag_desc\":null,\"category_meta_tag_title\":null,\"category_meta_tag_keywords\":null},{\"id\":2222,\"sp\":30,\"mrp\":30,\"sku\":null,\"name\":\"முருங்கை இலைப் பொடி\",\"descp\":\"Moringa leave Powder\\nMoringa leaf powder is full of amazing benefits\\nMoringa leaves are a powerhouse of nutrients and offer a myriad of health benefits. They are packed with vitamins, minerals, and antioxidants that can boost your overall well-being. From improving digestion and boosting immunity to reducing inflammation and promoting healthy skin, the benefits of consuming moringa leaves are truly impressive.\\nThese nutrient-dense leaves are known for their high levels of vitamin C, vitamin A, calcium, and iron, making them a great addition to any diet. Incorporating moringa leaves into your meals, whether through fresh leaves, powder, or supplements, can help support your health in numerous ways.\\nAdditionally, moringa leaves have been used in traditional medicine for centuries due to their medicinal properties. They are believed to have anti-inflammatory, antioxidant, and antimicrobial effects, making them a valuable natural remedy for various ailments.\\nOverall, adding moringa leaves to your diet can be a simple yet effective way to enhance your health and well-being. Whether you enjoy them in a smoothie, salad, or as a tea, the benefits of moringa leaves are certainly worth exploring.\\nMethod of use\\nTake one tablespoon of the powder mixed with lukewarm water or dipped in honey both morning and night. Take food after 30 minutes.\",\"images\":[\"murungailai_podi.webp\"],\"status\":\"001\",\"weight\":50,\"seo_url\":\"murungai-leaf-moringa-leave-powder\",\"size_id\":null,\"storeid\":4,\"eng_name\":\"Murungai Leaf / Moringa leave Powder\",\"imageurl\":\"murungailai_podi.webp\",\"quantity\":100,\"addtocart\":true,\"sortorder\":0,\"variation\":null,\"weight_id\":0,\"created_at\":\"2024-03-02 17:46:39\",\"updated_at\":\"2024-03-02 17:46:39\",\"category_id\":62,\"is_featured\":null,\"products_id\":2222,\"cartquantity\":\"2\",\"customizable\":0,\"category_name\":\"உலர் மூலிகைகள்\",\"city_shipping\":null,\"colorcodes_id\":null,\"delivery_time\":null,\"state_shipping\":null,\"category_status\":1,\"category_subcat\":1,\"category_cat_img\":\"https://assetsvilva.blr1.cdn.digitaloceanspaces.com/thaithingal/category-image/herbal-cosmetics.png\",\"category_seo_url\":\"raw-herbal\",\"category_storeid\":4,\"national_shipping\":null,\"products_group_id\":903,\"category_parent_id\":61,\"category_sortorder\":0,\"category_created_at\":\"2023-12-21 13:16:56\",\"category_updated_at\":\"2024-03-07 17:20:29\",\"category_description\":null,\"category_is_featured\":1,\"category_meta_tag_desc\":null,\"category_meta_tag_title\":null,\"category_meta_tag_keywords\":null},{\"id\":2164,\"sp\":25,\"mrp\":25,\"sku\":null,\"name\":\"ஆவாரம்பூ பொடி\",\"descp\":\"Aavarampoo powderBenefits of Aavarampoo powder: Aavarampoo powder is boiled and drunk to reduce the effect of diabetes.Awarambu powder helps in hair growth.Avarampoo powder also helps in repairing scalp hair fall and weak hair.Eye irritation caused by heat can