ary creativity and impress your guests with the delicious versatility of ILUPPAI POO SAMBA RICE! ??‍?</p><br><h2>Eco-Friendly Choice: Support Sustainable Farming ??</h2><br><p>Choosing ILUPPAI POO SAMBA RICE means you’re making a positive impact on the environment. Cultivated using sustainable practices, this rice supports local farmers and promotes biodiversity. Enjoy delicious meals while contributing to a healthier planet—opt for ILUPPAI POO SAMBA RICE for a sustainable and flavorful choice! ?❤️</p>\",\"shrtdesc\":\"<ul><li>??Traditional boiled rice??</li><li>Iluppai Poo Samba Rice offers subtle sweetness and rich nutrition. ??</li><li>Perfect for crafting wholesome, aromatic dishes. ?✨</li><li>Enhance your meals with this flavorful rice variety. ??</li></ul>\",\"seo_url\":\"premium-quality-iluppai-poo-samba-10kg-organic-handpicked-rice\",\"weight\":\"10\",\"city_shipping\":null,\"state_shipping\":null,\"national_shipping\":null,\"delivery_time\":null,\"status\":\"1\",\"is_featured\":null,\"category_storeid\":4,\"category_subcat\":2,\"category_is_featured\":1,\"category_name\":\"White Rice\",\"category_description\":null,\"category_seo_url\":\"white-rice\",\"category_meta_tag_title\":null,\"category_meta_tag_desc\":null,\"category_meta_tag_keywords\":null,\"category_cat_img\":\"https://assetsvilva.blr1.cdn.digitaloceanspaces.com/thaithingal/category-image/traditional-medicine.png\",\"category_parent_id\":49,\"category_sortorder\":0,\"category_status\":1,\"category_created_at\":\"2023-12-21 13:16:56\",\"category_updated_at\":\"2024-07-05 16:46:09\",\"cartquantity\":1,\"total\":1600,\"selectedWeights\":{\"id\":177,\"variations\":3,\"name\":\"10 kg\",\"code\":\"10 kg\",\"attribute_value\":\"10\",\"type\":1,\"updated_at\":\"2024-08-17 19:14:36\"},\"selectedWeight\":{\"id\":177,\"variations\":3,\"name\":\"10 kg\",\"code\":\"10 kg\",\"attribute_value\":\"10\",\"type\":1,\"updated_at\":\"2024-08-17 19:14:36\"}},{\"imageurl\":\"herbal-shampoo/redonion-shampoo200ml-1.webp