(100144, '2405:201:e026:a82d:183a:1cc9:ebc5:4bf5', 4, 'TTL0005381', 1, 103269, ' ', '+91', '63855381151', 'INR', 0, 525, 525, 0, 0, 0, 'Success', '2024-12-18 05:09:47', NULL, '{\"firstname\":\"\",\"lastname\":\"\",\"country\":\"1\",\"city\":\"\",\"pincode\":\"\",\"emailaddress\":\"\",\"phonenumber\":\"\",\"otpinput\":\"\",\"doorno_streetaddress\":\"\",\"location_town_district\":\"\",\"primary_addr\":1,\"firstnameError\":false,\"lastnameError\":false,\"countryError\":false,\"cityError\":false,\"pincodeError\":false,\"doorno_streetaddressError\":false,\"location_town_districtError\":false,\"emailaddressError\":false,\"phonenumberError\":false,\"otpinputError\":false,\"otpinputformError\":false,\"otpinputformErrorMsg\":\"Invalid OTP!\",\"otploader\":false,\"verifyotploader\":false,\"loginorsignupformError\":false,\"requestotploading\":false,\"otpverifyloading\":false,\"formError\":false,\"formloading\":false,\"formsuccessmsg\":false,\"messageError\":false,\"message\":\"\"}', 1, NULL, '{\"cartcount\":0,\"cartquantitycount\":0,\"products\":[{\"imageurl\":\"atturkichali.webp\",\"id\":537,\"storeid\":4,\"products_id\":537,\"category_id\":51,\"category_ids\":null,\"size_id\":null,\"colorcodes_id\":null,\"weight_id\":175,\"products_group_id\":194,\"quantity\":89,\"mrp\":105,\"sp\":105,\"sortorder\":0,\"visibility\":1,\"zoho_item_id\":\"1974293000000079019\",\"created_at\":\"2023-12-18 19:13:53\",\"updated_at\":\"2024-12-15 19:54:07\",\"esin\":\"5375140906\",\"meta_tag_title\":\"Buy Attur Kichali Rice Online - 100% Authentic & Nutrient-Rich\",\"meta_tag_desc\":\"Shop Attur Kichali Rice, a premium heirloom variety from Tamil Nadu. Low glycemic, nutrient-packed, and perfect for biryani, khichdi, and festive dishes. Taste tradition today!\",\"customizable\":0,\"variation\":\"3\",\"name\":\"ATTUR KICHALI RICE\",\"eng_name\":\"ATTUR KICHALI RICE\",\"sku\":null,\"descp\":\"<p><strong class=\\\"ql-size-huge\\\">Benefits for Attur Kichali Samba Rice ??</strong></p><p><br></p><p>Attur Kichali Samba rice is a powerhouse of health benefits, effectively promoting prosperity, physical strength, and enhanced immunity ?✨. Its unique slow digestion process not only keeps hunger at bay but also provides a rich source of iron and calcium, making it an essential addition to a nutritious diet ?.</p><p><br></p><p>Additionally, this rice has a low glycemic index, making it an ideal food for people with diabetes ??</p><p><br></p><p>Sustainably grown through organic farming practices ?, it is free from harmful pesticides and chemicals, ensuring both your health and the planet’s wellness ?.Sustainably grown through organic farming practices ?, it is free from harmful pesticides and chemicals, ensuring both your health and the planet’s wellness ?.</p><p><br></p><p>Incorporating Attur Kichali Samba rice into your daily diet can enhance your health and support sustainable agriculture. Give it a try for a nutritious and delicious meal! ??</p><p><br></p><p><strong class=\\\"ql-size-huge\\\">?️ How to Use</strong></p><p><br></p><p>Athur Kichali Samba is an excellent substitute for rice that can be incorporated into your daily meals. This versatile Rice can be enjoyed every day. Simply soak it for 30 minutes and then cook it in a rice cooker?.. It is perfect for creating delicious biryani, flavorful tomato rice, and a variety of mixed rice dishes. Additionally, it makes a wonderful ingredient for idli and dosa batter.?</p><p><br></p><p><strong class=\\\"ql-size-huge\\\">Delicious Recipe for Attur Kichali Samba:</strong></p><p><br></p><p>Attur Kichali Samba rice?</p><p><br></p><p>Perfect for Everyday Meals??</p><p><br></p><p>Excellent for Rice Cooker Use?️</p><p><br></p><p>Attur Kichali Samba is Fantastic for Flavorful Biryani?</p><p><br></p><p>Suitable for a Range of Rice Dishes?</p><p><br></p><p>Ideal for Attur Kichali Samba?️</p><p><br></p><p>Excellent for making Idli and Dosa?</p><p><br></p><p>Prepare tamarind rice with Athur Kichili rice.?</p><p><br></p><p><strong class=\\\"ql-size-huge\\\">ஆத்தூர் கிச்சலி சம்பா அரிசியின் நன்மைகள்???</strong></p><p><br></p><p>ஆத்தூர் கிச்சலி சம்பா அரிசியை தினமும் உணவாக எடுத்துக் கொள்ளும் பொழுது உடலுக்கு நல்ல செழுமையும், உடல் வலிமையும் கிடைக்கும்??. உடலுக்கு நோய் எதிர்ப்பு சக்தியை அளித்து நல்ல ஆரோக்கியமான உடல் நிலையை அளிக்கும். ஆத்தூர் கிச்சலி சம்பா அரிசி நல்ல செரிமானம் தனது செரிமான மண்டலத்தை ஆரோக்கியமாக வைத்திருக்கும்??️. இரும்பு மற்றும் சுண்ணாம்பு சத்து அதிகம் உள்ளதால் எலும்புகள் உறுதியாகும்??.</p><p><br></p><p>கூடுதலாக, அரிசி குறைந்த கிளைசெமிக் குறியீட்டைக் கொண்டுள்ளது, இது நீரிழிவு நோயாளிகளுக்கு ஏற்ற உணவாக அமைகிறது??.</p><p><br></p><p>ஆத்தூர் கிச்சலி சம்பா அரிசி பல நன்மைகள் வழங்குவதோடு மட்டுமில்லாமல் எந்த வித இரசாயான கலப்பில்லாமல் வேளாண்மை செய்யப்படுகிறது??. பாரம்பரிய முறையில் இயற்கை வழி வேளாண்மை செய்யப்பட்டு தைத்திங்கள் நிறுவன வாடிக்கையாளர்களுக்கு வழங்கப் படுகிறது??️.</p><p><br></p><p>ஆத்தூர் கிச்சலி சம்பா அரிசியை உங்கள் அன்றாட உணவில் சேர்த்துக்கொள்வது உங்கள் ஆரோக்கியத்தை மேம்படுத்துவதோடு ஓர் சத்தான மற்றும் ருசியான உணவாக அமைகிறது??️.</p><p><br></p><p><strong class=\\\"ql-size-huge\\\">பயன்படுத்தும் முறை:?️??</strong></p><p><br></p><p>அன்றாடம் சாப்பாடு சாப்பிட ஓர் சரியான மாற்று அரிசியாக ஆத்தூர் கிச்சலி சம்பா பயன்படும். தினமும் சாதகமாக வடித்து சாப்பிடலாம்??. 30 நிமிடம் ஊற வைத்து குக்கரிலும் சமைத்து சாப்பிடலாம். மேலும் பிரியாணி, தக்காளி சாதம் மேலும் பல கலவை சாதம் செய்ய ஏதுவான அரிசியாக ஆத்தூர் கிச்சலி சம்பா அமையும். இட்லி தோசை மாவிற்கும் பயன்படுத்தலாம்.</p><p><br></p><p><strong class=\\\"ql-size-huge\\\">ஆத்தூர் கிச்சலி சம்பா சுவையான உணவு செய்முறை?️??</strong></p><p><br></p><p>ஆத்தூர் கிச்சலி சம்பா சாதம்?</p><p><br></p><p>தினசரி உணவுக்கு சரியானது?</p><p><br></p><p>ரைஸ் குக்கர் பயன்படுத்துவதற்கு மிகவும் சிறந்தது.?</p><p><br></p><p>ஆத்தூர் கிச்சலி சம்பா சுவையான பிரியாணிக்கு சிறந்தது.?</p><p><br></p><p>கலவை சாத உணவுகளுக்கு மிகவும் பொருத்தமானது?</p><p><br></p><p>இட்லி மற்றும் தோசை செய்ய மிகவும் சிறந்தது.?</p><p><br></p><p>ஆத்தூர் கிச்சிலி சம்பாவில் புளி சாதம் செய்வது சுவையாக இருக்கும்?</p><p><br